import React from 'react';
import{ Link } from 'react-router-dom';
import './components.css'
import mechanicsList from '../mechanicslist.js'


function Mechanic(props) {
  const number = parseInt(props.match.params.number, 10);
  const mechanic = (number) => {
    for (var i = 0; i < mechanicsList.length; i++) {
      if (number === mechanicsList[i].id) {
        console.log(JSON.stringify(mechanicsList[i]));
        return mechanicsList[i];
      }
    }
  };

  if (!mechanic) {
    return <div>Sorry, but the mechanic was not found</div>
  }
  return (
    <div>
      <h1>{mechanic.name}</h1>
    </div>
  );
}

export default Mechanic;
